import { combineReducers } from "redux";
import modificatorsReducer from "./modificators-reducers";
import signUpReducer from "./signIn.reducer";

const finalReducer = combineReducers({
  modificatorsReducer,
  signInReducer,
  signUpReducer,
});

export default finalReducer;
